style.css:
@-moz-document domain("chatgpt.com") {
.text-center {
    display: none;
  }

  .m-auto {
    margin-top: 10px;
    margin-bottom: 10px;
  }

  .markdown {
    font-size: 20px;
  }

  .mx-auto .md\:max-w-3xl {
    max-width: 70% !important;
  }


  .lg\:max-w-\[40rem\] {
    max-width: 70% !important;
  }

  .py-2.px-3.text-base.md\:px-4.md\:py-5.lg\:px-5.xl\:px-5 {
    max-width: 70% !important;
  }

  @media (min-width: 768px) {
    .md\:max-w-3xl {
      max-width: 80% !important;
    }
  }

  @media (min-width: 1024px) {
    .lg\:max-w-\[40rem\] {
      max-width: 70% !important;
    }
  }

  .overflow-auto {
    overflow: clip;
  }

  .xl\:max-w-3xl {
    max-width: 7%;
  }
}
